import React from 'react';
import Button from './Button';
import './App.css';

class App extends React.Component {
  constructor(){
    super()
    this.state = {
      showerIsOn: false
    }
  }
  render() {
    return (
      <div className="App">
        <Button type={this.state.showerIsOn ? 'turn-shower-on' : 'turn-shower-off' }/>
      </div>
    )
  }
}

export default App;
